webpackJsonp([0x6c17ae1a1147],{422:function(e,t){e.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Это упражнение для тренировки широчайших мышц спины и заднего пучка дельтовидных мышц. Основное преимущество упражнения в том, что грудь упирается в скамью, тем самым снимая нагрузку с поясницы.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Исходное положение: нейтральным хватом возьмите гантели и лягте на скамью животом вниз. Руки необходимо опустить вниз.</li>\n<li>На выдохе – сгибая руки в локтях, выполните подъем гантелей вверх до уровня груди. Находясь в этом положении, сделайте небольшую задержку.</li>\n<li>На вдохе – медленно опустите гантели к исходному положению.</li>\n<li>Выполните необходимое количество повторений.</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/Wx3XrL5qO9Y" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/tyaga-gantelei-leja-na-skamje-na-jivote",efficiency:"7",title:"Тяга гантелей лежа на скамье на животе",image:"/static/1-00-0.png",image_2:"/static/1-00-1.png",image_3:"",image_4:"",filterby:"shoulders",date:"April 12, 2017",injury:"4",bodypart:"Плечи",filtertype:"isolated",type:"Изолирующее",filterinventory:"dumbbells",inventory:"Гантели",filterplace:""}}},pathContext:{}}}});
